(9392, 'flexible_content_2_text', '<h3>Prepare your timesheets without a calculator and save hours every payroll period. Homebase automatically identifies errors, including missed breaks or clock-outs. You can compare to the scheduled hours instantly.</h3>\r\n<ul class=\"tick\">\r\n 	<li>Total hours, calculate overtime, and subtract breaks automatically</li>\r\n 	<li>Identify errors automatically.</li>\r\n 	<li>Export directly to popular payroll providers without any data entry</li>\r\n</ul>'),
