(9392, 'flexible_content_3_text', '<h3>Homebase allows you to spend less time thinking about your timesheets. Use Homebase to track paid and unpaid breaks based on your state rules, see cash tips declarations totaled up on your timesheets, and reduce your risk with our free compliance tools.</h3>\r\n<h3>Time sheet tools include:</h3>\r\n<ul class=\"tick\">\r\n 	<li>Automatic calculations and overtime</li>\r\n 	<li>Compliance tools to reduce your risk</li>\r\n 	<li>Track breaks and tips</li>\r\n</ul>'),
